var title_f26_61_27606="Principles of polar body biopsy";
var content_f26_61_27606=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F53222&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F53222&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 601px\">",
"   <div class=\"ttl\">",
"    Principles of polar body biopsy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 581px; height: 489px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the absence of crossing-over, analysis of the first polar body (PBI) enables one to deduce the genetic status of the oocyte and, hence, whether the zygote could be affected. If PBI is heterozygous, crossing-over has occurred between homologous chromosomes and PBI analysis is noninformative. However, PB2 analysis enables deduction of the maternal contribution to the zygote. Polar body analysis provides no information about paternal genotype and has the theoretical disadvantage of inefficiency in autosomal recessive disorders. If segregation of a mutant paternal autosomal dominant gene is sought, blastomere analysis rather than polar body analysis is necessary.",
"    <div class=\"footnotes\">",
"     A: normal allele; a: mutant allele.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Simpson JL, Elias S. Genetics in Obstetrics and Gynecology, 3rd ed, WB Saunders, Philadelphia 2003. p.416. Copyright &copy; 2003 Elsevier Science.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
