var title_f26_61_27612="Diagnosis of Wiskott Aldrich";
var content_f26_61_27612=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F78822&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F78822&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for Wiskott-Aldrich syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Definitive diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male patient with congenital thrombocytopenia (less than 70,000 platelets/mm",
"        <sup>",
"         3",
"        </sup>",
"        ), small platelets, and at least one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Mutation in the WAS gene.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Absent WAS mRNA on Northern blot analysis of lymphocytes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Absent WASp protein in lymphocytes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Maternal cousins, uncles, or nephews with small platelets and thrombocytopenia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Probable diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male patient with congenital thrombocytopenia (less than 70,000 platelets/mm",
"        <sup>",
"         3",
"        </sup>",
"        ), small platelets, and at least one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Eczema.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Abnormal antibody response to polysaccharide antigens.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Recurrent bacterial or viral infections.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Autoimmune diseases.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        5. Lymphoma, leukemia, or other malignancies.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Possible diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male patient with thrombocytopenia (less than 70,000 platelets/mm",
"        <sup>",
"         3",
"        </sup>",
"        ) and small platelets, or male patient splenectomized for thrombocytopenia, who has at least one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Eczema.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Abnormal antibody response to polysaccharide antigens.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Recurrent bacterial or viral infections.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Autoimmune diseases.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        5. Lymphoma, leukemia, or other malignancies.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Patients with a definitive or probable diagnosis are assumed to have a greater than 98 and 85 percent probability, respectively, that in 20 years they will still have the same diagnosis. Patients with a possible diagnosis are those that have some but not all of the characteristic clinical or laboratory findings of a particular disorder.",
"    </div>",
"    <div class=\"reference\">",
"     From: Conley ME, Notarangelo LD, Etzioni A. Clin Immunol 1999; 93:190.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
